import React, { useContext } from "react";
import { Context } from "../index";

export const Basket = () => {
  const { userStore } = useContext(Context);
  if (!userStore.auth) {
    return (
      <div>
        <div>not Auth user</div>
      </div>
    );
  }
  return (
    <div>
      <div>basket</div>
    </div>
  );
};
